import './ExpenseItem.css';
function ExpenseItem() {
    return (
        <div className="expense-item"> 
            <div className="expense-item_description"> Nov 6 2022</div>
            <div>
                <h2>Car Insurance</h2>
                <div className="expense-item_price">$420</div>
            </div>
        </div>
    );
}

export default ExpenseItem;
